import React from 'react';

const SpotifyEmbed = ({ trackURI }) => {
  // Extract the Spotify ID from the URI
  const trackID = trackURI.split(':').pop();

  return (
    <div>
      <iframe style={{"border-radius":12}} src="https://open.spotify.com/embed/track/${trackID}?utm_source=generator" width="100%" height="152" allowfullscreen="" allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture" loading="lazy"></iframe>
    </div>
  );
};

export default SpotifyEmbed;
